async function uploadFile(bucketName, fileName, file) {
  const { data: { session } } = await wwLib.wwPlugins.supabaseAuth.publicInstance.auth.getSession();

  if (!session || !session.access_token) {
    throw new Error('Keine gültige Session gefunden');
